import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import ConfidentialityPage from './MainConfidentiality/ConfidentialPage';
import BlockUser from './BlockedUser/BlockUser';
import PasswordPage from './Password/Password';

const Stack = createStackNavigator();

const ConfNavigation = () => {
    return (
      
      <NavigationContainer>
        <Stack.Navigator
          initialRouteName="BlockUser"
          screenOptions={{
            headerShown: false, 
          }}
        >
        <Stack.Screen name="Confidentiality" component={ConfidentialityPage}/>
        <Stack.Screen name="BlockUsers" component={BlockUser}/>
        <Stack.Screen name="Passwor" component={PasswordPage}/>
        </Stack.Navigator>
      </NavigationContainer>
    );
  };
  
  export default ConfNavigation;
